import React  from 'react';      

// styles
import './imageView.scss'; 

interface ImageViewProps { 
  imageCard:string;
  nameCard:string;
  className?:string;
  onClick?:()=>void
 }  

const ImageView: React.FC<ImageViewProps> = ({ onClick, imageCard, nameCard, className }) => {   

  const classList = 'pg-imageView '+ className  

  return (
    <>
      <div className={'pg-imageView'} onClick={onClick} >   
        <img src={'./image/'+imageCard} alt={nameCard}  className={classList}/>
      </div>
    </>
  );
};


export default React.memo(ImageView);
